import React, { useEffect } from "react";
// import "./App.css";
import "./css_files/custom.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Navbar from "./components/layout/Navbar";
import Landing from "./components/layout/Landing";
import Login from "./components/auth/Login";
import Register from "./components/auth/Register";
import PrivateRoute from "./routing/PrivateRoute";
import PrivateRoute2 from "./routing/PrivateRoute2";
import ManageProducts from "./components/ManageProducts";
import PrivateRoutingManageProducts from "./routing/PrivateRoutingManageProducts";
import AddCategory from "./components/AddCategory";
import PrivateRoutingAddCategory from "./routing/PrivateRoutingAddCategory";
import ManageCategory from "./components/ManageCategory";
import PrivateRoutingManageCategories from "./routing/PrivateRoutingManageCategories";
import PrivateRoutingAddSubCategory from "./routing/PrivateRoutingAddSubCategory";
import ManageSubCategory from "./components/ManageSubCategory";
import PrivateRoutingManageSubCategory from "./routing/PrivateRoutingManageSubCategory";
import AddSubCategory from "./components/AddSubCategory";
import AboutUs from "./components/AboutUs";
import PrivateRoutingAboutUs from "./routing/PrivateRoutingAboutUs";	
import Dashboard from "./components/Dashboard";
import contactus from "./components/contactus";
import PrivateRoutingContactUs from "./routing/PrivateRoutingContactUs";
import PrivacyPolicy from "./components/PrivacyPolicy";
import PrivateRoutingPrivacyPolicy from "./routing/PrivateRoutingPrivacyPolicy";
import PrivateRouteReturnNRefundPolicy from "./routing/PrivateRoutingReturnNRefundPolicy";
import ReturnNRefundPolicy from './components/ReturnNRefundPolicy';
import PivateRoutingAdminPolicy from "./routing/PivateRoutingAdminPolicy";
import Adminpolicy from './components/AdminPolicy';
import PrivateRoutingFaq from "./routing/PrivateRoutingFaqs";
import Faqs from './components/Faq';
import TnC from './components/TnC';
import PrivateRoutingTnC from './components/TnC';
import AddProducts from './components/AddProducts'
import userDashboard from "./components/user-dashboard";
import PrivateRouteUserDashboard from "./routing/PrivateRouteUserDashboard";
import addBrands from "./components/add-brands";
import PrivateRouteAddBrands from "./routing/PrivateRouteAddBrands";
import manageBrands from "./components/manage-brands";
import PrivateRoutingManageBrands from "./routing/PrivateRoutingManageBrands";
import aboutUs from "./components/layout/aboutUs";
import adminPolicy from "./components/layout/adminPolicy";
import privacyPolicy from "./components/layout/privacyPolicy";
import contactUs from "./components/layout/contactUs";
import FAQs from "./components/layout/FAQs";
import returnRefundPolicy from "./components/layout/return&refundPolicy";
import tnc from "./components/layout/tnc";
import edit_products from "./components/edit_products";
import PrivateRoutingEditProducts from "./routing/PrivateRoutingEditProducts";
















//Auth//
import setAuthToken from "./utils/setAuthToken";
import store from "./store";
import { loadUser } from "./actions/auth";
import NotFound from "./components/NotFound";

if (localStorage.token) {
	setAuthToken(localStorage.token);
}

function App() {
	useEffect(() => {
		store.dispatch(loadUser());
	}, []);




	return (
		<>
			<div className="App">
				<Router>
					<Navbar />
					<Switch>
						<Route exact path="/" component={Landing} />
						<PrivateRoute exact path="/dashboard" component={Dashboard} />
						<PrivateRoute2 exact path="/add-products" component={AddProducts} />
						<PrivateRoutingManageProducts exact path="/manage-products" component={ManageProducts} />
						<PrivateRoutingAddCategory exact path="/add-category" component={AddCategory} />
						<PrivateRoutingManageCategories exact path="/manage-category" component={ManageCategory} />
						<PrivateRoutingAddSubCategory exact path="/add-subcategory" component={AddSubCategory} />
						<PrivateRoutingManageSubCategory exact path="/manage-subcategory" component={ManageSubCategory} />
						<PrivateRoutingAboutUs exact path="/aboutus" component={AboutUs} />
						<PrivateRoutingContactUs exact path="/contactus" component={contactus} />
						<PrivateRoutingPrivacyPolicy exact path="/privaypolicy" component={PrivacyPolicy} />
						<PrivateRouteReturnNRefundPolicy exact path="/return-refund-policy" component={ReturnNRefundPolicy} />
						<PivateRoutingAdminPolicy exact path="/admin-policy" component={Adminpolicy} />
						<PrivateRoutingFaq exact path="/faqs" component={Faqs} />
						<PrivateRoutingTnC exact path="/tnc" component={TnC} />
						<PrivateRouteUserDashboard exact path="/user-dashboard" component={userDashboard} />
						<PrivateRouteAddBrands exact path="/add-brands" component={addBrands} />
						<PrivateRoutingManageBrands exact path="/manage-brands" component={manageBrands} />
						<PrivateRoutingEditProducts exact path="/manage-brands" component={manageBrands} />
						<Route exact path="/register" component={Register} />
						<Route exact path="/login" component={Login} />
						<Route exact path="/about" component={aboutUs} />
						<Route exact path="/adminPolicy" component={adminPolicy} />
						<Route exact path="/privacy" component={privacyPolicy} />
						<Route exact path="/contact" component={contactUs} />
						<Route exact path="/return&refund" component={returnRefundPolicy} />
						<Route exact path="/faq" component={FAQs} />
						<Route exact path="/t&c" component={tnc} />
						<Route exact path="" component={NotFound} />
					</Switch>
				</Router>
			</div>
		</>
	);
}

export default App;
